package com.audaxis.compiere.model.proxy;

import org.compiere.model.MRequisitionLine;

import com.audaxis.compiere.model.BasicProxy;

public class MRequisitionLineProxy extends BasicProxy<MRequisitionLine> {

	MRequisitionLine po;
	public MRequisitionLineProxy(MRequisitionLine po) {
		super(po);
		this.po=po;
		// TODO Auto-generated constructor stub
	}
	/** Set QtyEntered.
    @param Qty QtyEntered */
    public void setQtyEntered (java.math.BigDecimal QtyEntered)
    {
       
        po.set_Value("QtyEntered",QtyEntered);
        
    }
    
    /** Get QtyEntered.
    @return QtyEntered */
    public java.math.BigDecimal getQtyEntered() 
    {
        return po.get_ValueAsBigDecimal("QtyEntered");
        
    }
    /** Set Supplier_ID.
    @param  Supplier_ID */
    public void setSupplier_ID (int Supplier_ID)
    {
       
        po.set_Value("Supplier_ID",Supplier_ID);
        
    }
    
    /** Get Supplier_ID.
    @return Supplier_ID */
    public int getSupplier_ID() 
    {
        return po.get_ValueAsInt("Supplier_ID");
        
    }
    
}
